import re

def parse_switch_log(log):
    # Split log into lines
    lines = log.splitlines()

    # Define regex to extract FRAMES RX and FRAMES TX
    regex = r"\|\s+(\d+)\s*\|\s+(\d+)\s*\|"

    total_rx, total_tx = 0, 0

    for line in lines:
        match = re.search(regex, line)
        if match:
            frames_rx = int(match.group(1))
            frames_tx = int(match.group(2))
            total_rx += frames_rx
            total_tx += frames_tx

    return total_rx, total_tx

